tables.table_schema:
CREATE TABLE ad_tracking ( 
    ad_id INT, 
    ad_name TEXT, 
    impression_count INT, 
    click_through_rate DECIMAL 
);

CREATE TABLE impressions (
  impression_id INT PRIMARY KEY,
  ad_id INT,
  impression_date DATE
);
CREATE TABLE click_through_rates (
  click_id INT PRIMARY KEY,
  ad_id INT,
  click_date DATE
);

CREATE TABLE impressions (
    id INT PRIMARY KEY,
    ad_id INT,
    user_id INT,
    timestamp TIMESTAMP
);

CREATE TABLE ads (
    id INT PRIMARY KEY,
    ad_name VARCHAR(255),
    ad_type VARCHAR(50),
    ad_budget DECIMAL(10, 2)
);
